A CNF formula is a conjunction of clauses and a clause a disjunction of literals. This means we can represent a formula as a set of sets of literals. By arbitrarily ordering the elements of the sets, we could use a Vec<Vec<Lit>> to represent a formula. Such a representation has too much memory overhead per clause though. Each clause requires a separate allocation, which also hurts cache locality when iterating over the clauses of a large formula. Instead Varisat provides the CnfFormula type, which stores all literals in a single Vec . When iterating over a CnfFormula the clauses can be accessed as slices. # extern crate varisat;
# use varisat::lit::{Var, Lit};
use varisat::cnf::CnfFormula; let mut formula = CnfFormula::new(); let (a, b, c) = (Lit::from_dimacs(1), Lit::from_dimacs(2), Lit::from_dimacs(3)); formula.add_clause(&[a, b, c]);
formula.add_clause(&[!a, !b]);
formula.add_clause(&[!b, !c]);
formula.add_clause(&[!a, !c]); assert_eq!(formula.iter().last().unwrap(), &[!a, !c]);

