Varisat provides routines for parsing and writing Formulas in the DIMACS CNF format. # extern crate varisat;
# use varisat::lit::{Var, Lit};
use varisat::dimacs::{DimacsParser, write_dimacs}; let input = b"p cnf 3 2
1 2 3 0
-1 -3 0
"; let implements_read = &input[..]; let mut formula = DimacsParser::parse(implements_read).expect("parse error"); formula.add_clause(&[Lit::from_dimacs(2)]); let mut implements_write = vec![]; write_dimacs(&mut implements_write, &formula); assert_eq!(implements_write, b"p cnf 3 3
1 2 3 0
-1 -3 0
2 0
");

