Incremental clause additions simply means that further calls to Solver::add_clause , Solver::add_formula or Solver::add_dimacs_cnf are allowed after Solver::solve returned. The new clauses are added to the clauses that were already present prior to the last solve call. # extern crate varisat;
use varisat::solver::Solver;
use varisat::lit::Lit; let (x, y, z) = (Lit::from_dimacs(1), Lit::from_dimacs(2), Lit::from_dimacs(3)); let mut solver = Solver::new();
solver.add_clause(&[!x, y]);
solver.add_clause(&[!y, z]);
assert_eq!(solver.solve().unwrap(), true); solver.add_clause(&[!z, x]);
assert_eq!(solver.solve().unwrap(), true); solver.add_clause(&[!z, !y]);
solver.add_clause(&[z, y]);
assert_eq!(solver.solve().unwrap(), false);

