Once clauses are added to the solver they cannot be removed anymore. Instead assumptions can be used to limit the search to a subset of solutions. Assumptions fix the values of certain variables. This is equivalent to adding some unit clauses to the formula, with the difference that assumptions can be removed again. Assumptions are set by calling Solver::assume , which replaces any previous assumptions. Using additional helper variables, assumptions can be used to emulate removable clauses: # extern crate varisat;
use varisat::solver::Solver;
use varisat::lit::Lit; let (x, y, z) = (Lit::from_dimacs(1), Lit::from_dimacs(2), Lit::from_dimacs(3));
let ignore_clauses = Lit::from_dimacs(4); let mut solver = Solver::new();
solver.add_clause(&[!x, y]);
solver.add_clause(&[!y, z]);
assert_eq!(solver.solve().unwrap(), true); solver.add_clause(&[!z, x]);
assert_eq!(solver.solve().unwrap(), true); solver.add_clause(&[ignore_clauses, !z, !y]);
solver.add_clause(&[ignore_clauses, z, y]); solver.assume(&[!ignore_clauses]);
assert_eq!(solver.solve().unwrap(), false); solver.assume(&[]); // Clears assumptions
solver.add_clause(&[ignore_clauses]); assert_eq!(solver.solve().unwrap(), true); When a formula is unsatisfiable under multiple assumptions, Varisat may be able to find a smaller set of assumptions that is sufficient for unsatisfiability. Such a sufficient subset of assumptions can be retrieved using Solver::failed_core .
